import { useState } from 'react';
import './Register.css';
import { createUserWithEmailAndPassword } from 'firebase/auth';
import { setDoc, doc } from 'firebase/firestore';
import { auth, db } from "./firebase";


function Register() {

  const [donorFullname, setDonorFullname] = useState('');
  const [donorEmail, setDonorEmail] = useState('');
  const [donorPhoneNo, setDonorPhoneNo] = useState('');
  const [donorBloodtype, setDonorBloodtype] = useState('');
  const [donorAddress, setDonorAddress] = useState('');
  
  const handleDonorRegistration = async (e) => {
    e.preventDefault();
    try{
      await createUserWithEmailAndPassword(auth, donorEmail, donor)
    } catch(error){

    }
  }
  return (
    <section id="register" className="register-section">
      <div className="container">
        <h2>Become a Blood Donor</h2>
        <p>Join our community of heroes and help save lives</p>
        <div className="register-form">
          <form id="donorRegistrationForm">
            {/* Row 1: Name and Email */}
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="fullName" className="form-label">Full Name*</label>
                <input type="text" id="fullName" className="form-control" required />
              </div>
              <div className="form-group">
                <label htmlFor="email" className="form-label">Email Address*</label>
                <input type="email" id="email" className="form-control" required />
              </div>
            </div>

            {/* Row 2: Phone and Blood Type */}
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="phone" className="form-label">Phone Number*</label>
                <input type="tel" id="phone" className="form-control" required />
              </div>
              <div className="form-group">
                <label htmlFor="donorBloodType" className="form-label">Blood Type*</label>
                <select id="donorBloodType" className="form-control" required>
                  <option value="">Select Blood Group</option>
                  <option value="A+">A+</option>
                  <option value="A-">A-</option>
                  <option value="B+">B+</option>
                  <option value="B-">B-</option>
                  <option value="AB+">AB+</option>
                  <option value="AB-">AB-</option>
                  <option value="O+">O+</option>
                  <option value="O-">O-</option>
                </select>
              </div>
            </div>

            {/* Row 3: Address (full width) */}
            <div className="form-row">
              <div className="form-group address-group">
                <label htmlFor="address" className="form-label">Address*</label>
                <textarea id="address" className="form-control" rows="3" required></textarea>
              </div>
            </div>

            {/* Checkboxes (each on its own row) */}
            <div className="form-group">
              <label htmlFor="medicalEligible" className="checkbox-label">
                <input type="checkbox" id="medicalEligible" required /> I confirm that I am medically eligible to donate blood and meet all health requirements.
              </label>
            </div>
            <div className="form-group">
              <label htmlFor="agreeTerms" className="checkbox-label">
                <input type="checkbox" id="agreeTerms" required /> I agree to the terms and conditions.
              </label>
            </div>
            <div className="form-group">
              <label htmlFor="agreePolicy" className="checkbox-label">
                <input type="checkbox" id="agreePolicy" required /> I agree to the privacy policy.
              </label>
            </div>

            {/* Submit Button */}
            <button type="submit" className="register-form-button">Register as Donor</button>
          </form>
        </div>
      </div>
    </section>
  );
}

export default Register;
